import React from 'react';
import { PowerBIEmbed } from 'powerbi-client-react'
import '../StyleSheets/Income.css';
import { models } from 'powerbi-client';



function Report() {

    const embedConfig = 
    { 
        type: 'report', 
        id: '<Report Id>', 
        embedUrl: '<Embed Url>', 
        accessToken: '<Access Token>', 
        tokenType: models.TokenType.Embed, 
        settings: 
        { panes: 
            { filters: 
                { expanded: false, 
                    visible: false, 
                }, 
            }, 
        }
            , }; const eventHandlers = new Map([ ['loaded', function () { console.log('Report loaded'); }], ['rendered', function () { console.log('Report rendered'); }], ['error', function (event) { console.log(event.detail); }], ]); const cssClassName = 'report-style-class'; const getEmbeddedComponent = (embeddedReport) => { window.report = embeddedReport;};
    return (
        <div className="Container">
            <h1>Hello World</h1>
            <p>This is the Report content area.</p>
        </div>
    );
}

export default Report;
